import React from 'react';

const HeaderApp = () => {
  return (
    <header>
      <div className="logo">
        <img src="logo.png" alt="Logo" />
      </div>
      <div className="sections">
        <nav>
          <ul>
            <li>Section 1</li>
            <li>Section 2</li>
            <li>Section 3</li>
            <li>Section 4</li>
          </ul>
        </nav>
      </div>
      <div className="image">
        <img src="image.png" alt="Image" />
      </div>
    </header>
  );
};

export default HeaderApp;
